var relativeFrequency = [];

	relativeFrequency[i] = frequency[0] / frequency[i];
}

var wordsElo = [];
for (let i = 0; i < relativeFrequency.length; i++) {
	wordsElo[i] = 400 * Math.log(relativeFrequency[i]) / Math.log(10);
}

function eloToIndex (searchedElo) {
	left = leftLim;
	right = rightLim;
	while (left < right) {
		m = Math.floor((left + right) / 2);
		if (wordsElo[m] < searchedElo) {
			left = m + 1;
		}
		else {
			right = m;
		}
	}
	return left;
}

function updateRecommendedWord() {
	document.getElementById("word").innerHTML = words[recommendWordIndex(userElo)];
}

function recommendWordIndex (currentElo) {
	index = eloToIndex(currentElo);
	
	left = Math.max(index - range, leftLim);
	right = Math.min(index + range, rightLim);
	index = Math.floor(Math.random() * (right - left + 1)) + left;
	
	currentWordIndex = index;
	//document.getElementById("3").innerHTML = "Current word index is " + index;
	return index;
}

function updateElo (score) {
	expected = 1 / (1 + Math.pow(10, (wordsElo[currentWordIndex] - userElo) / 400));
	
	userElo += kFactor * (score - expected);
	
	kFactor *= kFactorChange;
	kFactor = Math.max(kFactor, minKFactor);
	
	//document.getElementById("2").innerHTML = "Expected score was " + expected + ", current k is " + kFactor + ", user elo is " + userElo + ", and answer count is " + answerCount;
}

function calculateKnownWords() {
	document.getElementById("unknownWords").innerHTML = "Unknown words: ";
	for (let i = 0; i < unknownWords.length; i++) {
		document.getElementById("unknownWords").innerHTML += unknownWords[i];
		if (i < unknownWords.length - 1) {
			document.getElementById("unknownWords").innerHTML += ", ";
		}
	}
	
	left = 0;
	right = 3000;
	performanceElo = 1500;
	while (right - left > 0.00001) {
		performanceElo = (left + right) / 2;
		expected = 0;
		for (let i = 0; i < answerLimit; i++) {
			expected += 1 / (1 + Math.pow(10, (answerElo[i] - performanceElo) / 400));
		}
		if (expected < points) {
			left = performanceElo;
		}
		else {
			right = performanceElo;
		}
	}
	
	//document.getElementById("5").innerHTML = wordsElo;
	estimatedVocabularySize = 0.0;
	for (let i = 0; i < words.length; i++) {
		expected = 1 / (1 + Math.pow(10, (wordsElo[i] - performanceElo) / 400));
		estimatedVocabularySize += expected;
	}
	//document.getElementById("6").innerHTML = estimatedVocabularySize;
	
	return Math.floor(estimatedVocabularySize);
}

function updateScore (score) {
	points += score;
	answerElo[answerCount] = wordsElo[currentWordIndex];
	answerCount++;
	updateElo(score);
	
	if (score == 0) {
		unknownWords.push(words[currentWordIndex]);
	}
	
	if (answerCount < answerLimit) {
		updateRecommendedWord();
	}
	else {
		document.getElementById("quiz").style.display = "none";
		document.getElementById("result").style.display = "block";
		
		knownWords = calculateKnownWords();
		if (knownWords <= 300) {
			document.getElementById("finalScore").innerHTML = "You know " + knownWords + " words or less.";
		}
		else if (knownWords >= 50000) {
			document.getElementById("finalScore").innerHTML = "You know " + knownWords + " words or more.";
		}
		else {
			document.getElementById("finalScore").innerHTML = "Estimated vocabulary size is " + knownWords;
		}
	}
}
